		public static string DeCompress(string Base64Text)
		{
			byte[] gzBuffer = Convert.FromBase64String(Base64Text);
			
			using (MemoryStream ms = new MemoryStream())
			{
				int msgLength = BitConverter.ToInt32(gzBuffer, 0);
				ms.Write(gzBuffer, 4, gzBuffer.Length - 4);

				byte[] buffer =new byte[msgLength];

				ms.Position = 0;
				using (GZipStream zip =new GZipStream(ms, CompressionMode.Decompress))
				{
					zip.Read(buffer, 0, buffer.Length);
				}
				
				return Encoding.UTF8.GetString(buffer);
			}
		}
		
		public static string Mimikatz()
		{			
			string Mimikatz = "";
			return DeCompress(Mimikatz);
		}
			
		public static string MS14_068()
		{			
			string MS14_068 = "";
			return DeCompress(MS14_068);
		}
		
		public static string ReactOS()
		{			
			string ReactOS = "";
			return DeCompress(ReactOS);
		}

